   var coordExitClasses = function(coord) {
      for ( var exits = [], i = 0; i < coord.exits.length; i++ ) {
         if ( coord.x == coord.exits[i]['0'] && coord.y > coord.exits[i]['1'] ) {
            exits.push('ettop');
         }
         if ( coord.x == coord.exits[i]['0'] && coord.y < coord.exits[i]['1'] ) {
            exits.push('ebottom');
         }
         if ( coord.y == coord.exits[i]['1'] && coord.x > coord.exits[i]['0'] ) {
            exits.push('eleft');
         }
         if ( coord.y == coord.exits[i]['1'] && coord.x < coord.exits[i]['0'] ) {
            exits.push('eright');
         }
      }
      return exits.join(' ');
   };

